import React, { useState } from "react";

export default function FilterSongsByAudioFeatures() {
  const [instrumentalness, setInstrumentalness] = useState(0);
  const [energy, setEnergy] = useState(0);
  const [valence, setValence] = useState(0);
  const [liveness, setLiveness] = useState(0);
  const [acousticness, setAcousticness] = useState(0);
  const [songs, setSongs] = useState([]);
  const [error, setError] = useState("");

  const fetchSongs = async () => {
    try {
      const queryParams = new URLSearchParams({
        instrumentalness: instrumentalness > 0 ? instrumentalness : undefined,
        energy: energy > 0 ? energy : undefined,
        valence: valence > 0 ? valence : undefined,
        liveness: liveness > 0 ? liveness : undefined,
        acousticness: acousticness > 0 ? acousticness : undefined,
      });

      const response = await fetch(
        `http://localhost:8080/songs/audio-features?${queryParams}`
      );

      if (!response.ok) {
        if (response.status === 404) {
          throw new Error("No songs found matching the specified audio features.");
        }
        throw new Error("Error fetching songs.");
      }

      const data = await response.json();
      setSongs(data);
      setError("");
    } catch (error) {
      setError(error.message);
      setSongs([]);
    }
  };

  return (
    <div>
      <header>
        <h1>Filter Songs by Audio Features</h1>
        <p>Use the sliders below to filter songs by their audio feature values.</p>
      </header>

      <div className="sliders">
        <div>
          <label>Instrumentalness: {instrumentalness}</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.01"
            value={instrumentalness}
            onChange={(e) => setInstrumentalness(parseFloat(e.target.value))}
          />
        </div>
        <div>
          <label>Energy: {energy}</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.01"
            value={energy}
            onChange={(e) => setEnergy(parseFloat(e.target.value))}
          />
        </div>
        <div>
          <label>Valence: {valence}</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.01"
            value={valence}
            onChange={(e) => setValence(parseFloat(e.target.value))}
          />
        </div>
        <div>
          <label>Liveness: {liveness}</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.01"
            value={liveness}
            onChange={(e) => setLiveness(parseFloat(e.target.value))}
          />
        </div>
        <div>
          <label>Acousticness: {acousticness}</label>
          <input
            type="range"
            min="0"
            max="1"
            step="0.01"
            value={acousticness}
            onChange={(e) => setAcousticness(parseFloat(e.target.value))}
          />
        </div>
        <button onClick={fetchSongs}>Search Songs</button>
      </div>

      <div className="results">
        {error ? (
          <p className="error">{error}</p>
        ) : (
          <table>
            <thead>
              <tr>
                <th>Title</th>
                <th>Instrumentalness</th>
                <th>Energy</th>
                <th>Valence</th>
                <th>Liveness</th>
                <th>Acousticness</th>
                <th>URL</th>
              </tr>
            </thead>
            <tbody>
              {songs.map((song) => (
                <tr key={song.id}>
                  <td>{song.title}</td>
                  <td>{song.instrumentalness}</td>
                  <td>{song.energy}</td>
                  <td>{song.valence}</td>
                  <td>{song.liveness}</td>
                  <td>{song.acousticness}</td>
                  <td>
                    <a href={song.url} target="_blank" rel="noopener noreferrer">
                      Listen
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
